import React from "react";
import Navbarprofile from "../../Components/Navbarprofile/Navbarprofile";
import Navprofile from "../../Components/navprofile/Navprofile";
import PropTypes from "prop-types";
import Button from "@mui/material/Button";
import { styled } from "@mui/material/styles";
import Dialog from "@mui/material/Dialog";
import DialogTitle from "@mui/material/DialogTitle";
import DialogContent from "@mui/material/DialogContent";
import DialogActions from "@mui/material/DialogActions";
import IconButton from "@mui/material/IconButton";
import CloseIcon from "@mui/icons-material/Close";
import Typography from "@mui/material/Typography";
import Tabpanell from "../../Components/Tabpanel/Tabpanell";
import EditIcon from "@mui/icons-material/Edit";
import { useState } from "react";
import { makeStyles } from "@mui/styles";
import DialogContentText from "@mui/material/DialogContentText";
import TextField from "@mui/material/TextField";
import InputUnstyled, { inputUnstyledClasses } from "@mui/base/InputUnstyled";

import {
  MDBCol,
  MDBContainer,
  MDBRow,
  MDBCard,
  MDBCardBody,
  MDBCardImage,
  MDBBtn,
  MDBTypography,
} from "mdb-react-ui-kit";
import { Grid } from "@mui/material";
const CustomInput = React.forwardRef(function CustomInput(props, ref) {
  const { slots, ...other } = props;
  return (
    <InputUnstyled
      slots={{
        root: StyledInputRoot,
        input: StyledInputElement,
        ...slots,
      }}
      {...other}
      ref={ref}
    />
  );
});

CustomInput.propTypes = {
  slots: PropTypes.shape({
    input: PropTypes.elementType,
    root: PropTypes.elementType,
    textarea: PropTypes.elementType,
  }),
};
const BootstrapDialog = styled(Dialog)(({ theme }) => ({
  "& .MuiDialogContent-root": {
    padding: theme.spacing(2),
  },
  "& .MuiDialogActions-root": {
    padding: theme.spacing(1),
  },
}));
const useStyles = makeStyles((theme) => ({
  photoContainer: {
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    height: "120px",
    width: "120px",
    border: "1px solid black",
    cursor: "pointer",
  },
  photo: {
    height: "100%",
    width: "100%",
    objectFit: "contain",
  },
}));
const useStyless = makeStyles({
  root: {
    "& label.Mui-focused": {
      color: "#810CA8",
    },
    "& .MuiInput-underline:after": {
      borderBottomColor: "#810CA8",
    },
    "& .MuiOutlinedInput-root:hover .MuiOutlinedInput-notchedOutline": {
      borderColor: "#810CA8",
    },
  },
});
const Profile = () => {
  const [open, setOpen] = React.useState(false);

  const handleClickOpen = () => {
    setOpen(true);
  };
  const handleClose = () => {
    setOpen(false);
  };
  const classes = useStyles();
  const [photo, setPhoto] = useState(null);

  const handlePhotoChange = (event) => {
    const file = event.target.files[0];
    const reader = new FileReader();
    reader.onload = (e) => {
      setPhoto(e.target.result);
    };
    reader.readAsDataURL(file);
  };

  const handlePhotoClick = () => {
    if (photo) {
      window.open(photo);
    }
  };
  function BootstrapDialogTitle(props) {
    const { children, onClose, ...other } = props;

    return (
      <DialogTitle sx={{ m: 0, p: 2 }} {...other}>
        {children}
        {onClose ? (
          <IconButton
            aria-label="close"
            onClick={onClose}
            sx={{
              position: "absolute",
              right: 8,
              top: 8,
              // color: "#2D033B",
            }}
          >
            <CloseIcon />
          </IconButton>
        ) : null}
      </DialogTitle>
    );
  }
  BootstrapDialogTitle.propTypes = {
    children: PropTypes.node,
    onClose: PropTypes.func.isRequired,
  };
  {
    /*********************************************************************************/
  }
  const classeusername = useStyless();
  const [openusername, setOpenusername] = React.useState(false);

  const handleClickOpenusername = () => {
    setOpenusername(true);
  };

  const handleCloseusername = () => {
    setOpenusername(false);
  };

  {
    /*********************************************************************************/
  }
  const classefirstname = useStyless();
  const [openfirstname, setOpenfirstname] = React.useState(false);

  const handleClickOpenfirstname = () => {
    setOpenfirstname(true);
  };

  const handleClosefirstname = () => {
    setOpenfirstname(false);
  };

  {
    /*********************************************************************************/
  }
  const classelastname = useStyless();
  const [openlastname, setOpenlastname] = React.useState(false);

  const handleClickOpenlastname = () => {
    setOpenlastname(true);
  };

  const handleCloselastname = () => {
    setOpenlastname(false);
  };
  {
    /*********************************************************************************/
  }
  const classeemail = useStyless();
  const [openemail, setOpenemail] = React.useState(false);

  const handleClickOpenemail = () => {
    setOpenemail(true);
  };

  const handleCloseemail = () => {
    setOpenemail(false);
  };
  {
    /*********************************************************************************/
  }
  const classetown = useStyless();
  const [opentown, setOpentown] = React.useState(false);

  const handleClickOpentown = () => {
    setOpentown(true);
  };

  const handleClosetown = () => {
    setOpentown(false);
  };
  {
    /*********************************************************************************/
  }
  const classeavg = useStyless();
  const [openavg, setOpenavg] = React.useState(false);

  const handleClickOpenavg = () => {
    setOpenavg(true);
  };

  const handleCloseavg = () => {
    setOpenavg(false);
  };
  {
    /*********************************************************************************/
  }
  const classedes = useStyless();
  const [opendes, setOpendes] = React.useState(false);

  const handleClickOpendes = () => {
    setOpendes(true);
  };

  const handleClosedes = () => {
    setOpendes(false);
  };
  {
    /*********************************************************************************/
  }
  const classepassword = useStyless();
  const [openpassword, setOpenpassword] = React.useState(false);

  const handleClickOpenpassword = () => {
    setOpenpassword(true);
  };

  const handleClosepassword = () => {
    setOpenpassword(false);
  };
  {
    /************************************************************************************************/
  }
  const [formErrors, setFormErrors] = useState({});
  const [errorMessage, setErrorMessage] = useState(null);
  const [fnamevalue, setfnamevalue] = React.useState({
    firstname: "",
  });
  const [useramevalue, setuseramevalue] = React.useState({
    username: "",
  });
  const [lastamevalue, setlastamevalue] = React.useState({
    lastname: "",
  });
  const [emailvalue, setemailvalue] = React.useState({
    email: "",
  });
  const [homeadressvalue, sethomeadressvalue] = React.useState({
    homeadress: "",
  });
  const [passwordvalue, setpasswordvalue] = React.useState({
    password: "",
  });
  const [Confirmpasswordvalue, setConfirmpasswordvalue] = React.useState({
    Confirmpassword: "",
  });
  const [phonevalue, setphonevalue] = React.useState({
    Phone: "",
  });
  const [avgvalue, setavgvalue] = React.useState({
    avg: "",
  });
  const [descriptionvalue, setdescriptionvalue] = React.useState({
    description: "",
  });
  return (
    <div
      style={{
        display: "flex",
        justifyItems: "column",
        width: "100%",
      }}
    >
      <div
        style={{
          display: "inline-block",
          position: "sticky",
          top: 0,
          height: "100%",
        }}
      >
        <Navprofile />
      </div>

      <div
        style={{
          width: "100%",
          display: "flex",
          flexDirection: "column",
          justifyContent: "center",
        }}
      >
        <div
          style={{
            height: "65px",
            top: 0,
            right: 0,
            position: "sticky",
            width: "100%",
            zIndex: 2,
          }}
        >
          <Navbarprofile />
        </div>
        <div
          style={{
            zIndex: "0",
            display: "inline-block",
          }}
        >
          <MDBContainer className="py-5 h-100">
            <MDBRow className="justify-content-center align-items-center h-100">
              <MDBCol xl="12" lg="10" md="10" sm="10" xs="8">
                <MDBCard>
                  <div
                    className="rounded-top text-white d-flex flex-row"
                    style={{
                      height: "300px",
                    }}
                  >
                    <div
                      className="ms-4 mt-5 "
                      style={{
                        width: "150px",
                        marginLeft: "20px",

                        height: "200px",
                        display: "flex",
                        flexDirection: "column",
                      }}
                    >
                      <MDBCardImage
                        src="https://i.pinimg.com/564x/e1/be/95/e1be95e26e853c491ff3a09e6b996783.jpg"
                        alt="Generic placeholder image"
                        className="img-thumbnail"
                        fluid
                        style={{ width: "150px", zIndex: "0" }}
                      />

                      <div
                        style={{
                          marginTop: "10px",
                          display: "flex",

                          marginRight: "0px",
                          width: "150px",
                          padding: "0px",
                        }}
                      >
                        <MDBBtn
                          className="mx-2"
                          color="light"
                          rippleColor="dark"
                          onClick={handleClickOpen}
                          style={{
                            height: "28px",
                            width: "135px",
                            fontSize: "18px",
                            padding: "0px",
                            margin: "0px",
                          }}
                        >
                          <div>Edit profile</div>
                        </MDBBtn>
                        <BootstrapDialog
                          onClose={handleClose}
                          aria-labelledby="customized-dialog-title"
                          open={open}
                          sx={{
                            boxShadow: "0 8px 32px rgba(31,28,135,0.37)",
                            backdropFilter: " blur(8.5px)",
                          }}
                        >
                          <BootstrapDialogTitle
                            id="customized-dialog-title"
                            onClose={handleClose}
                            sx={{ color: "#2D033B" }}
                          >
                            Edit Profile
                          </BootstrapDialogTitle>
                          <DialogContent dividers sx={{ width: "500px" }}>
                            <p style={{ color: "grey" }}>Profile photo</p>

                            <div
                              style={{
                                display: "flex",
                                justifyContent: "center",
                              }}
                            >
                              <div
                                className={classes.photoContainer}
                                onClick={handlePhotoClick}
                              >
                                {photo && (
                                  <img
                                    src={photo}
                                    alt="photo"
                                    className={classes.photo}
                                  />
                                )}
                              </div>
                            </div>
                            <div
                              style={{
                                display: "flex",
                                justifyContent: "center",
                                marginTop: "5px",
                              }}
                            >
                              <Button
                                variant="Text"
                                component="label"
                                color="secondary"
                                sx={{ mt: 2, mb: 2, color: "#810CA8" }}
                              >
                                Upload File
                                <input
                                  type="file"
                                  hidden
                                  onChange={handlePhotoChange}
                                />
                              </Button>
                            </div>
                            {/**********************************************************************************************/}
                            <p style={{ color: "grey" }}>
                              Personal information
                            </p>
                            <div
                              style={{
                                display: "flex",
                                justifyContent: "space-between",
                              }}
                            >
                              <p style={{ color: "black" }}>Username</p>
                              <IconButton onClick={handleClickOpenusername}>
                                <EditIcon />
                              </IconButton>
                              <Dialog open={openusername}>
                                <BootstrapDialogTitle
                                  id="customized-dialog-title"
                                  onClose={handleCloseusername}
                                  sx={{ color: "#2D033B", margin: "0px" }}
                                ></BootstrapDialogTitle>
                                <DialogContent>
                                  <CustomInput
                                    autoFocus
                                    margin="dense"
                                    id="username"
                                    label="username"
                                    type="username"
                                    fullWidth
                                    variant="standard"
                                    className={classeusername.root}
                                    sx={{ margin: "0px" }}
                                  />
                                </DialogContent>
                                <DialogActions>
                                  <Button
                                    autoFocus
                                    onClick={handleCloseusername}
                                    sx={{ color: "#2D033B" }}
                                  >
                                    Save changes
                                  </Button>
                                </DialogActions>
                              </Dialog>
                            </div>
                            <div
                              style={{
                                display: "flex",
                                justifyContent: "space-between",
                              }}
                            >
                              <p style={{ color: "black" }}>First name</p>
                              <IconButton onClick={handleClickOpenfirstname}>
                                <EditIcon />
                              </IconButton>
                              <Dialog open={openfirstname}>
                                <BootstrapDialogTitle
                                  id="customized-dialog-title"
                                  onClose={handleClosefirstname}
                                  sx={{ color: "#2D033B", margin: "0px" }}
                                ></BootstrapDialogTitle>
                                <DialogContent>
                                  <TextField
                                    autoFocus
                                    margin="dense"
                                    id="first_name"
                                    label="First name"
                                    type="firstname"
                                    fullWidth
                                    variant="standard"
                                    className={classefirstname.root}
                                    sx={{ margin: "0px" }}
                                  />
                                </DialogContent>
                                <DialogActions>
                                  <Button
                                    autoFocus
                                    onClick={handleClosefirstname}
                                    sx={{ color: "#2D033B" }}
                                  >
                                    Save changes
                                  </Button>
                                </DialogActions>
                              </Dialog>
                            </div>

                            <div
                              style={{
                                display: "flex",
                                justifyContent: "space-between",
                              }}
                            >
                              <p style={{ color: "black" }}>Last name</p>
                              <IconButton onClick={handleClickOpenlastname}>
                                <EditIcon />
                              </IconButton>
                              <Dialog open={openlastname}>
                                <BootstrapDialogTitle
                                  id="customized-dialog-title"
                                  onClose={handleCloselastname}
                                  sx={{ color: "#2D033B", margin: "0px" }}
                                ></BootstrapDialogTitle>
                                <DialogContent>
                                  <TextField
                                    autoFocus
                                    margin="dense"
                                    id="last_name"
                                    label="Last name"
                                    type="lastname"
                                    fullWidth
                                    variant="standard"
                                    className={classelastname.root}
                                    sx={{ margin: "0px" }}
                                  />
                                </DialogContent>
                                <DialogActions>
                                  <Button
                                    autoFocus
                                    onClick={handleCloselastname}
                                    sx={{ color: "#2D033B" }}
                                  >
                                    Save changes
                                  </Button>
                                </DialogActions>
                              </Dialog>
                            </div>
                            <div
                              style={{
                                display: "flex",
                                justifyContent: "space-between",
                              }}
                            >
                              <p style={{ color: "black" }}>Email</p>
                              <IconButton onClick={handleClickOpenemail}>
                                <EditIcon />
                              </IconButton>
                              <Dialog open={openemail}>
                                <BootstrapDialogTitle
                                  id="customized-dialog-title"
                                  onClose={handleCloseemail}
                                  sx={{ color: "#2D033B", margin: "0px" }}
                                ></BootstrapDialogTitle>
                                <DialogContent>
                                  <TextField
                                    autoFocus
                                    margin="dense"
                                    id="email"
                                    label="Email"
                                    type="Email"
                                    fullWidth
                                    variant="standard"
                                    className={classeemail.root}
                                    sx={{ margin: "0px" }}
                                  />
                                </DialogContent>
                                <DialogActions>
                                  <Button
                                    autoFocus
                                    onClick={handleCloseemail}
                                    sx={{ color: "#2D033B" }}
                                  >
                                    Save changes
                                  </Button>
                                </DialogActions>
                              </Dialog>
                            </div>
                            <div
                              style={{
                                display: "flex",
                                justifyContent: "space-between",
                              }}
                            >
                              <p style={{ color: "black" }}>Password</p>
                              <IconButton onClick={handleClickOpenpassword}>
                                <EditIcon />
                              </IconButton>
                              <Dialog open={openpassword}>
                                <BootstrapDialogTitle
                                  id="customized-dialog-title"
                                  onClose={handleClosepassword}
                                  sx={{ color: "#2D033B", margin: "0px" }}
                                ></BootstrapDialogTitle>
                                <DialogContent
                                  sx={{
                                    display: "flex",
                                    justifyContent: "center",
                                    flexDirection: "column",
                                  }}
                                >
                                  <TextField
                                    size="small"
                                    autoFocus
                                    margin="dense"
                                    id="password"
                                    label="Password"
                                    type="Password"
                                    //fullWidth
                                    variant="standard"
                                    className={classepassword.root}
                                    sx={{ marginBottom: "16px" }}
                                  />
                                  <TextField
                                    size="small"
                                    autoFocus
                                    margin="dense"
                                    id="confirm_password"
                                    label=" Confirm Password"
                                    type=" Password"
                                    //fullWidth
                                    variant="standard"
                                    className={classepassword.root}
                                  />
                                </DialogContent>
                                <DialogActions>
                                  <Button
                                    autoFocus
                                    onClick={handleClosepassword}
                                    sx={{ color: "#2D033B" }}
                                  >
                                    Save changes
                                  </Button>
                                </DialogActions>
                              </Dialog>
                            </div>
                            <div
                              style={{
                                display: "flex",
                                justifyContent: "space-between",
                              }}
                            >
                              <p style={{ color: "black" }}>Home Adress</p>
                              <IconButton onClick={handleClickOpentown}>
                                <EditIcon />
                              </IconButton>
                              <Dialog open={opentown}>
                                <BootstrapDialogTitle
                                  id="customized-dialog-title"
                                  onClose={handleClosetown}
                                  sx={{ color: "#2D033B", margin: "0px" }}
                                ></BootstrapDialogTitle>
                                <DialogContent>
                                  <TextField
                                    autoFocus
                                    margin="dense"
                                    id="Home Adress"
                                    label="home_adress"
                                    type="Home Adress"
                                    fullWidth
                                    variant="standard"
                                    className={classetown.root}
                                    sx={{ margin: "0px" }}
                                  />
                                </DialogContent>
                                <DialogActions>
                                  <Button
                                    autoFocus
                                    onClick={handleClosetown}
                                    sx={{ color: "#2D033B" }}
                                  >
                                    Save changes
                                  </Button>
                                </DialogActions>
                              </Dialog>
                            </div>
                            <div
                              style={{
                                display: "flex",
                                justifyContent: "space-between",
                              }}
                            >
                              <p style={{ color: "black" }}>
                                Average Response Time
                              </p>
                              <IconButton onClick={handleClickOpenavg}>
                                <EditIcon />
                              </IconButton>
                              <Dialog open={openavg}>
                                <BootstrapDialogTitle
                                  id="customized-dialog-title"
                                  onClose={handleCloseavg}
                                  sx={{ color: "#2D033B", margin: "0px" }}
                                ></BootstrapDialogTitle>
                                <DialogContent>
                                  <TextField
                                    autoFocus
                                    margin="dense"
                                    id="avg"
                                    label="Average Response Time"
                                    type="Average Response Time"
                                    fullWidth
                                    variant="standard"
                                    className={classeavg.root}
                                    sx={{ margin: "0px" }}
                                  />
                                </DialogContent>
                                <DialogActions>
                                  <Button
                                    autoFocus
                                    onClick={handleCloseavg}
                                    sx={{ color: "#2D033B" }}
                                  >
                                    Save changes
                                  </Button>
                                </DialogActions>
                              </Dialog>
                            </div>
                            <div
                              style={{
                                display: "flex",
                                justifyContent: "space-between",
                              }}
                            >
                              <p style={{ color: "black" }}>Description</p>
                              <IconButton onClick={handleClickOpendes}>
                                <EditIcon />
                              </IconButton>
                              <Dialog open={opendes}>
                                <BootstrapDialogTitle
                                  id="customized-dialog-title"
                                  onClose={handleClosedes}
                                  sx={{ color: "#2D033B", margin: "0px" }}
                                ></BootstrapDialogTitle>
                                <DialogContent>
                                  <TextField
                                    autoFocus
                                    margin="dense"
                                    id="description"
                                    label=" Description"
                                    type=" Description"
                                    fullWidth
                                    variant="standard"
                                    className={classedes.root}
                                    sx={{ margin: "0px" }}
                                  />
                                </DialogContent>
                                <DialogActions>
                                  <Button
                                    autoFocus
                                    onClick={handleClosedes}
                                    sx={{ color: "#2D033B" }}
                                  >
                                    Save changes
                                  </Button>
                                </DialogActions>
                              </Dialog>
                            </div>
                          </DialogContent>
                          <DialogActions
                            sx={{ display: "flex", justifyContent: "row" }}
                          >
                            <Button
                              autoFocus
                              sx={{
                                color: "red",
                                marginRight: "200px",
                              }}
                            >
                              Delete Account
                            </Button>
                            <Button
                              autoFocus
                              onClick={handleClose}
                              sx={{ color: "#2D033B" }}
                            >
                              Save changes
                            </Button>
                          </DialogActions>
                        </BootstrapDialog>
                      </div>
                    </div>

                    <Grid
                      container
                      spacing={1}
                      //className="ms-3"
                      style={{
                        marginTop: "50px",
                        marginLeft: "50px",
                        //backgroundColor: "red",
                        display: "flex",

                        height: "180px",
                      }}
                    >
                      <Grid
                        xs={10}
                        sx={{
                          // backgroundColor: "green",
                          height: "40px",
                        }}
                      >
                        <MDBTypography
                          tag="div" // wrap the <p> elements in a <div> container
                          style={{
                            display: "flex", // use flexbox to align the <p> elements horizontally
                            margin: "0px",
                            flexDirection: "column", // vertically center the <p> elements
                            marginRight: "45px",
                            color: "#2D033B",
                            fontSize: "13px",
                          }}
                        >
                          <div
                            style={{
                              display: "flex", // use flexbox to align the <p> elements horizontally
                              //padding: "0px",
                              flexDirection: "row",
                            }}
                          >
                            <h2
                              style={{
                                color: "black",
                                fontSize: "18px",
                                marginBottom: "15px",
                                padding: "0px",
                              }}
                            >
                              {localStorage.getItem("username")}
                            </h2>
                          </div>

                          <div
                            style={{
                              display: "flex", // use flexbox to align the <p> elements horizontally

                              flexDirection: "row",
                            }}
                          >
                            <p
                              style={{
                                marginRight: "10px",
                                color: "#2D033B",
                                fontSize: "10px",
                                // marginRight: "10px",
                                margin: "0px",
                              }}
                            >
                              HOME ADRESS:
                            </p>
                            <p
                              style={{
                                color: "gray",
                                fontSize: "10px",
                                margin: "0px",
                                fontFamily: "sans-serif",
                              }}
                            >
                              {localStorage.getItem("homeAddress")}
                            </p>
                          </div>
                          <br />
                          <div
                            style={{
                              display: "flex", // use flexbox to align the <p> elements horizontally
                              marginRight: "10px",
                              margin: "0px",
                              flexDirection: "row",
                            }}
                          >
